// src/App.js

import React, { Component } from 'react';
import Locales from './components/locales';

class App extends Component {

  state = {
    locales: []
  }

  componentDidMount() {
    fetch('/api/v1/locales')
    .then(res => res.json())
    .then(console.log)
    .then((data) => {
      this.setState({ locales: data.content })
    })
    .catch(console.log)
  }

  render() {
    return (
        <Locales locales={this.state.locales} />
    )
  }
}

export default App;
